import React from 'react'
import { Link } from 'react-router-dom';
import Logo from '../assets/imgs/logo.png'
function SlidBar() {
  return (
    <div className=" flex flex-col  items-center justify-between h-full align-center ">
      {/* Start Image Logo */}
      <img src={Logo} alt="logo" style={{ width: "#50px", height: "50px" }} />
      {/* End Image Logo */}
      {/* Start List Link Pages */}
      <div>
      <ul className="list-none  text-center menu w-full pt-24" id="menu">
                        <li className="pt-6 ">
                            <Link className="ml-2 mr-4 flex flex-col py-3 rounded-full  text-textcolor hover:text-hover " to='/'>
                                <i className="fa fa-home text-3xl "></i>
                                <span className="text-1xl">home</span></Link>
                        </li>
                        

                    </ul>
          
      </div>
      {/* End List Link Pages */}

      {/* Start The Contact */}
      <div>
        <div className=" flex flex-col  items-center justify-between  h-full align-center ">
          <Link to="/"><i className="fa fa-linkedin text-9xl text-center text-textcolor hover:text-hover text-xl pb-3"></i> </Link>
          <Link to="/"><i className="fa fa-github text-9xl text-center text-textcolor hover:text-hover text-xl  pb-3"></i> </Link>
          <Link to="/"><i className="fa fa-facebook text-9xl text-center text-textcolor hover:text-hover text-xl  pb-3"></i> </Link>
          <Link to="/"><i className="fa fa-instagram text-9xl text-center text-textcolor hover:text-hover text-xl  pb-3"></i> </Link>
        </div>
      </div>
      {/* End The Contact */}
    </div>
  )
}

export default SlidBar
